import React from 'react'

function AdminNav({handleAllProducts, handleAllUsers, handleForm, handleReturned}) {
  return (
    <div className='dashboardMenu'>
    <button onClick={handleForm} className="triggerWrapper">Add a product</button>
    <button onClick={handleReturned} className="triggerWrapper">Approve Returns</button>
    <button onClick={handleAllProducts} className="triggerWrapper">All Products</button>
    <button onClick={handleAllUsers} className="triggerWrapper">All Users</button>

    </div>
  )
}

export default AdminNav
